class Admin{constructor(e){this.id=null!=e.id?e.id:null,this.name=e.name,this.login=e.login,this.access_level=e.access_level,this.active=e.active}getAccessLevel(){return 1==this.access_level?"Master":"Analista"}getActive(){return"yes"==this.active?"text-success":"text-danger"}}class User{constructor(e){this.id=null!=e.id?e.id:null,this.name=e.name,this.info=e.info,this.image=e.image,this.address=e.address,this.email=e.email,this.phone=e.user_phones}getId(){return this.id}getName(){return this.name}getInfo(){return this.info}getAddress(){return this.address}getEmail(){return this.email}getImage(){return this.image}getPhone(){return this.phone}setId(e){this.id=e}setName(e){this.name=e}setImage(e){this.image=e}setInfo(e){this.info=e}setAddress(e){this.address=e}setEmail(e){this.email=e}setPhone(e){let s=new UserPhone(e);this.phone.push(s)}getValues(){return{id:this.id,name:this.name,email:this.email,address:this.address,info:this.info,phone:this.phone.filter(function(e,s){return""!=e.trim()})}}}class UserPhone{constructor(e){this.id=null!=e.id?e.id:null,this.phone=e.phone,this.user_id=e.user_id}getId(){return this.id}getUserId(){return this.user_id}getPhone(){return this.phone}setId(e){this.id=e}setPhone(e){this.phone=e}setUserId(e){this.user_id=e}}